import React from 'react';
import { Sidebar, Menu, MenuItem, SubMenu } from 'react-pro-sidebar';
import styles from '../styles/Sidebar.module.css';  // Update the import path to use the module

const CustomSidebar = () => {
  return (
    <Sidebar className={styles.container}>
      <Menu>
        <SubMenu title="Charts" className={styles.menuItem}>
          <MenuItem> Pie charts </MenuItem>
          <MenuItem> Line charts </MenuItem>
        </SubMenu>
        <MenuItem className={styles.menuItem}> Documentation </MenuItem>
        <MenuItem className={styles.menuItem}> Calendar </MenuItem>
      </Menu>
    </Sidebar>
  );
}

export default CustomSidebar;
